import React from "react";
import "./About.css";

function About() {
  return (
    <div>
      <header classname="first-head">
        <div id="Professional">Aloha</div>
        <div id="Proficiencies">howdy</div>
        <div id="Non-Technical"></div>
        <div id="Passions"></div>
      </header>
    </div>
  );
}

export default About;
